import './generate-weight';

window.onload = () => {
    const link = document.getElementById('link');
    let blob = new Blob([`Список рекомендаций. 
    По итогам теста Вами было набрано баллов: ${generateWeight()}`],
        {type: 'text/plain'});

    link.href = URL.createObjectURL(blob);
};
